class PostJob extends Component {
  render() {
    return (
      <div className="post-job-container">
        <form className='postjob-fromcontainer'>
          <div className='input-container'>
            <input type="text" placeholder='Job Title' className='input-field' />
          </div>
          <div className='input-container'>
            <input type="text" placeholder='Company' className='input-field' />
          </div>
          <div className='input-container'>
            <input type="text" placeholder='Location' className='input-field' />
          </div>
          <div className='input-container'>
            <input type="text" placeholder='Salary' className='input-field' />
          </div>
          <div className='input-container'>
            <input type="text" placeholder='Description' className='input-field' />
          </div>

        </form>
      </div>
    );
  }
}

export default PostJob;
